import java.util.Arrays;
import java.util.HashMap;
import java.util.UUID;

public class Example {
    public static void main(String[] args) {
        SeedRequestParametersClient client = SeedRequestParametersClient
            .builder()
            .build();

        client.user().getUsername(
            GetUsersRequest
                .builder()
                .limit(1)
                .id(UUID.fromString("d5e9c84f-c2b2-4bf4-b4b0-7ffd7a9ffc32"))
                .date("2023-01-15")
                .deadline(OffsetDateTime.parse("2024-01-15T09:30:00Z"))
                .bytes("SGVsbG8gd29ybGQh".getBytes())
                .user(
                    User
                        .builder()
                        .name("name")
                        .tags(
                            Arrays.asList("tags", "tags")
                        )
                        .build()
                )
                .userList(
                    Arrays.asList(
                        User
                            .builder()
                            .name("name")
                            .tags(
                                Arrays.asList("tags", "tags")
                            )
                            .build(),
                        User
                            .builder()
                            .name("name")
                            .tags(
                                Arrays.asList("tags", "tags")
                            )
                            .build()
                    )
                )
                .keyValue(
                    new HashMap<String, String>() {{
                        put("keyValue", "keyValue");
                    }}
                )
                .nestedUser(
                    NestedUser
                        .builder()
                        .name("name")
                        .user(
                            User
                                .builder()
                                .name("name")
                                .tags(
                                    Arrays.asList("tags", "tags")
                                )
                                .build()
                        )
                        .build()
                )
                .excludeUser(
                    Arrays.asList(
                        User
                            .builder()
                            .name("name")
                            .tags(
                                Arrays.asList("tags", "tags")
                            )
                            .build()
                    )
                )
                .filter(
                    Arrays.asList("filter")
                )
                .longParam(1000000L)
                .bigIntParam(new BigInteger("1000000"))
                .optionalDeadline(OffsetDateTime.parse("2024-01-15T09:30:00Z"))
                .optionalString("optionalString")
                .optionalUser(
                    User
                        .builder()
                        .name("name")
                        .tags(
                            Arrays.asList("tags", "tags")
                        )
                        .build()
                )
                .build()
        );
    }
}

